def copy_memory(destination, source, length):
    # 确保source有足够的数据可供复制（简化示例）
    if len(source) < length:
        raise ValueError("Source string is shorter than the specified length")

    return destination[:length] + source[length:]

# 示例用法：将"Hello"字符串复制到缓冲区
def main():
    # 假设目标和源是内存中的字节序列（例如，使用bytes对象表示）
    target_buffer = bytearray(5)  # 创建一个长度为5的缓冲区
    source_string = "Hello"

    try:
        copied_result = copy_memory(target_buffer, source_string, len(source_string))
        print("Copied result:", copied_result)

        # 将结果转换回字符串（如果需要）
        copied_string = copied_result.decode('utf-8')
        print("Original string (after copy):", copied_string)
    except ValueError as e:
        print(e)

if __name__ == "__main__":
    main()
